import merchItem from '../sample-merch-item.jpg'


function Merch() {
  return (
        <div>
            <div class="container" style = {{height: 850}}>
                <h3>Merch</h3>
                <div style = {{marginTop: 30, marginBottom: 30}}>
                <div class="row" style = {{display: 'flex', flexDirection: 'row'}}>
                    <MerchCard 
                        imgUrl = {merchItem}
                        title = "Long Sleeve Shirt"
                        price = "$32.00"/>
